// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./JuniorToken.sol";
import "./SeniorToken.sol";
import "./SkyrimToken.sol";

contract SkyrimInvestMarket is Ownable {
    using SafeERC20 for ERC20;
    using SafeERC20 for JuniorToken;
    using SafeERC20 for SeniorToken;
    using SafeERC20 for SkyrimToken;

    using Address for address;
    using SafeMath for uint256;

    ERC20 public DAIToken;
    SeniorToken public STToken;
    JuniorToken public JTToken;
    SkyrimToken public TRAToken;

    struct STInvestInfo {
        uint256 amount; 
        uint256 share; 
    }
    mapping(address => STInvestInfo) public STInvestInfoMap;

    struct JTInvestInfo {
        uint256 amount;
        uint256 share;
    }
    mapping(address => JTInvestInfo) public JTInvestInfoMap;

    uint256 public MinInvestBySTAmount; 
    uint256 public MaxInvestBySTAmount; 

    uint256 public MinInvestByJTAmount; 
    uint256 public MaxInvestByJTAmount; 

    uint256 public totalInvestByST; 
    uint256 public totalInvestByJT; 

    uint256 public totalShareOfST;
    uint256 public totalShareOfJT;

    uint256 public shareOfPerSTToken;
    uint256 public shareOfPerJTToken;

    uint256 public STOfPerShare;
    uint256 public JTOfPerShare;


    // tokenRate =  totalShareOfST / totalInvestByST;
    // shareOfUser = token * tokenRate
    // shareRate = totalInvestByST / totalShareOfST;
    // tokenAmountOfUser = shareOfUser * shareRate

    // EVENT
    event EInvestST(address indexed account, uint256 amount);
    event EInvestJT(address indexed account, uint256 amount);
    event ERedeemWithST(address indexed account, uint256 amount);
    event ERedeemWithJT(address indexed account, uint256 amount);

    constructor(address DAIToken_, address SJToken_, address JTToken_, address TRAToken_) payable {
        // Verify input addresses
        require(DAIToken_.isContract() && SJToken_.isContract() && JTToken_.isContract(), "SkyrimInvestMarket: An input address is not a contract");
        STToken = SeniorToken(SJToken_);
        JTToken = JuniorToken(JTToken_);
        DAIToken = ERC20(DAIToken_);
        TRAToken = SkyrimToken(TRAToken_);

        MinInvestBySTAmount = 0;
        MaxInvestBySTAmount = 2**256 - 1;

        MinInvestByJTAmount = 0;
        MaxInvestByJTAmount = 2**256 - 1;
    }

    function investST(address account, uint256 amount) external onlyOwner {
        require(
            amount >= MinInvestBySTAmount && amount <= MaxInvestBySTAmount,
            "Skyrim: _investByST amount out of range"
        );

        STInvestInfo storage userInvestInfo = STInvestInfoMap[account];

        userInvestInfo.amount = userInvestInfo.amount.add(amount);
        userInvestInfo.share = userInvestInfo.amount.mul(shareOfPerSTToken);

        totalInvestByST = totalInvestByST.add(amount);
        totalShareOfST = totalShareOfST.add(userInvestInfo.share);

        shareOfPerSTToken = totalShareOfST.div(totalInvestByST);
        STOfPerShare = totalInvestByST.div(totalShareOfST);

        emit EInvestST(account, amount);
    }

    function investJT(address account, uint256 amount) external onlyOwner {
        require(
            amount >= MinInvestByJTAmount && amount <= MaxInvestByJTAmount,
            "SkyrimInvestMarket: Deposit amount out of range"
        );

        JTInvestInfo storage userInvestInfo = JTInvestInfoMap[account];

        userInvestInfo.amount = userInvestInfo.amount.add(amount);
        userInvestInfo.share = userInvestInfo.amount.mul(shareOfPerJTToken);

        totalInvestByJT = totalInvestByJT.add(amount);
        totalShareOfJT = totalShareOfJT.add(userInvestInfo.share);

        shareOfPerJTToken = totalShareOfJT.div(totalInvestByJT);
        JTOfPerShare = totalInvestByJT.div(totalShareOfJT);

        DAIToken.safeTransferFrom(msg.sender, address(this), amount);

        emit EInvestJT(account, amount);
    }

    function redeemWithST(uint256 amount)
        external
        onlyOwner
        returns (uint256 STActualAmountWithdrawn, uint256 TRAActualAmountWithdrawn)
    {
        require(
            amount > 0,
            "SkyrimInvestMarket - redeemWithST: amount is 0"
        );


        TRAToken.safeTransfer(msg.sender, amount);

        emit ERedeemWithST(msg.sender, amount);

        return (amount, amount);
    }

    function redeemWithJT(uint256 amount)
        external
        onlyOwner
        returns (uint256 JTActualAmountWithdrawn, uint256 TRAActualAmountWithdrawn)
    {
        require(
            amount > 0,
            "SkyrimInvestMarket - redeemWithJT: amount is 0"
        );

        TRAToken.safeTransfer(msg.sender, amount);

        emit ERedeemWithJT(msg.sender, amount);

        return (amount, amount);
    }

    function claimRewards() external {
        // comptroller.claimComp(address(this));
        // ERC20 comp = ERC20(comptroller.getCompAddress());
        // comp.safeTransfer(rewards, comp.balanceOf(address(this)));
    }

    function setMinInvestBySTAmount(uint256 amount) public onlyOwner {
        require(amount <= MaxInvestBySTAmount && amount > 0, "Skyrim - setMinInvestBySTAmount: invalid amount");

        MinInvestBySTAmount = amount;
    }

    function setMaxInvestBySTAmount(uint256 amount) public onlyOwner {
        require(amount >= MinInvestBySTAmount && amount > 0, "Skyrim - setMaxInvestBySTAmount: invalid amount");

        MaxInvestBySTAmount = amount;
    }

    function setMinInvestByJTAmount(uint256 amount) public onlyOwner {
        require(amount <= MaxInvestByJTAmount && amount > 0, "Skyrim - setMinInvestByJTAmount: invalid amount");

        MinInvestByJTAmount = amount;
    }

    function setMaxInvestByJTAmount(uint256 amount) public onlyOwner {
        require(amount >= MinInvestByJTAmount && amount > 0, "Skyrim - setMaxInvestByJTAmount: invalid amount");

        MaxInvestByJTAmount = amount;
    }
}
